import React, { useContext, useEffect } from 'react'
import UrlsContextProvider, { UrlsContext } from '../contexts/UrlsContext'

const IndexPage = () => {
  const { urls } = useContext(UrlsContextProvider)

  useEffect(() => {
    console.log(urls)
  }, [])

  return (
    <div>
      <UrlsContextProvider>
        <h1>Index Page</h1>
        {urls.length === 0 ? (
          <p>No Urls Here</p>
        ) : (
          urls.map((url, index) => <p>{url.url}</p>)
        )}
      </UrlsContextProvider>
    </div>
  )
}

export default IndexPage
